import React, { Component } from "react";
import bars from "../bars.svg";

export default function RotatingNav() {
  return (
    <nav>
      <ul>
        <li>
          <img src={bars}></img>
          Home
        </li>
        <li>About</li>
        <li>Contact</li>
      </ul>
    </nav>
  );
}
